import React, { Fragment, useState } from 'react'
const DOCCHAT = ({}) => { 
    return (
        <Fragment>
       
<body>
	<header class = "header">
	<nav    class = "navbar">
	<ul     class = "nav-menu">
	<li     class = "nav-item"> <a href   = "MAinp.html" class   = "nav-logo">Home</a> </li>
	<li     class = "nav-item"> <a href   = "artyou.html" class  = "nav-link">Articles</a> </li>
	<li     class = "nav-item"> <a href   = "docchat.html" class = "nav-link">Find a doctor</a> </li>
	<li     class = "nav-item"> <a href   = "psychat.html" class = "nav-link">Find a psychologist</a> </li>
	<li     class = "nav-item"> <a href   = "room.html" class    = "nav-link">Chat Room</a> </li>
	<li     class = "nav-item">   <a href = "login.html" class   = "button">Logout</a> </li>
			</ul>
			<div class = "hamburger"> <span class = "bar"></span> <span class = "bar"></span> <span class = "bar"></span> </div>
		</nav>
	</header>
    <div class = "container mt-5">
	<div class = "row d-flex ">
	<div class = "col-md-7">
	<div class = "card p-3 py-4">
					
					<div class = "text-center mt-3"> <span class     = "bg-secondary p-1 px-4 rounded text-white">Pro</span>
					<h5  class = "mt-2 mb-0">Alexender Schidmt</h5> <span>UI/UX Designer</span>
					<div class = "px-4 mt-1">
					<p   class = "fonts">Consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. </p>
						</div>
						<ul    class = "social-list">
						<li><i class = "fa fa-facebook"></i></li>
						<li><i class = "fa fa-dribbble"></i></li>
						<li><i class = "fa fa-instagram"></i></li>
						<li><i class = "fa fa-linkedin"></i></li>
						<li><i class = "fa fa-google"></i></li>
						</ul>
						<div class = "buttons"> <button class = "btn btn-outline-primary px-4">Message</button> <button class = "btn btn-primary px-4 ms-3">Contact</button> </div>
					</div>
				</div>
			</div>
		</div>
	</div>
</body>


    </Fragment>
    )
    }
    const hamburger = document.querySelector(".hamburger");
    const navMenu   = document.querySelector(".nav-menu");
    hamburger.addEventListener("click", mobileMenu);
    
    function mobileMenu() {
        hamburger.classList.toggle("active");
        navMenu.classList.toggle("active");
    }
    const navLink = document.querySelectorAll(".nav-link");
    
    navLink.forEach(n => n.addEventListener("click", closeMenu));
    
    function closeMenu() {
        hamburger.classList.remove("active");
        navMenu.classList.remove("active");
    }
export default DOCCHAT;
